using Microsoft.VisualStudio.TestTools.UnitTesting;
using System;
using System.Collections.Generic;
using System.Linq;
using System.Text;

namespace UnitTestProject
{
    [TestClass]
    public class UnitTest686
    {
        [TestMethod]
        public void TestValidPalindromeII()
        {
            Assert.IsTrue(RepeatedStringMatch("a", "") == 10000);
            Assert.IsTrue(RepeatedStringMatch("a", "a") == 1);
            Assert.IsTrue(RepeatedStringMatch("abc", "cabcabca") == 4);
            Assert.IsTrue(RepeatedStringMatch("abcd", "cdabcdab") == 3);
        }
        public int RepeatedStringMatch(string A, string B)
        { 
            var repeatTime = 1;
            var repeatStr = new StringBuilder();
            repeatStr.Append(A);
            while (repeatStr.Length < B.Length)
            {
                repeatStr.Append(A);
                repeatTime++;
            }

            if (repeatStr.ToString().IndexOf(B) > -1)
            {
                Console.WriteLine(repeatTime);
                return repeatTime;
            }

            repeatStr.Append(A);
            repeatTime++;
            if (repeatStr.ToString().IndexOf(B) > -1)
            {
                Console.WriteLine(repeatTime);
                return repeatTime;
            }


            return -1;
        }


    }
}
